// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.7; 

import "./Builder.sol";

contract TestBuilder is Builder  {

    constructor(ISeedToken _SEED) Builder(_SEED) {}

    function test_calculateReward(uint256 _stkTime, uint8 _sId) public view {
        calculateReward(_stkTime, _sId);
    }

    function test_calculateYieldTime(uint256 _start, uint256 _bound) public view {
        calculateYieldTime(_start,  _bound);
    }
}
